function normalizeWhitespace(text) { return text.replace(/\s+/g, ' ').trim(); }
function removePunctuation(text) { return text.replace(/[^a-zA-Z0-9\s-]/g, ''); }
function toLower(text) { return text.toLowerCase(); }
function collapseDashes(text) { return text.replace(/-+/g, '-'); }
function trimDashes(text) { return text.replace(/^-+|-+$/g, ''); }
function log(name, value) { console.log(name + ':', value); }

// TODO: implement slugify
function slugify(text) {
    // implement
}

function assertEqual(actual, expected) {
    const expectedList = Array.isArray(expected) ? expected : [expected];
    return expectedList.includes(actual);
}
function runTest(input, expected) {
    const actual = slugify(input);
    if (!assertEqual(actual, expected)) {
        console.log('FAIL', input, '=>', actual);
        return false;
    }
    return true;
}

const tests = [
    ['Hello World', 'hello-world'],
    ['  Multiple   spaces  here ', 'multiple-spaces-here'],
    ['Clean_this-up!', ['cleanthis-up', 'clean_this-up', 'clean-this-up']],
    ['Already--Slugified', ['already-slugified', 'already--slugified']]
];

let ok = 0;
for (const [input, expected] of tests) {
    if (runTest(input, expected)) ok++;
}

if (ok === tests.length) {
    console.log('ALL TESTS PASSED');
} else {
    console.log('FAILED:', ok + '/' + tests.length);
}

