let passed = 0;
let total = 0;
function test(label, actual, expected) {
    total++;
    if (assertEqual(actual, expected, label)) passed++;
}

const sample = '<script>alert("XSS")</script>';
const sample2 = 'Tom & Jerry > Spike < Dog';
const sample3 = "Quote: 'Hello' and \"World\"";

// Tests
test('script tag', escapeHtml(sample), [
    '&lt;script&gt;alert("XSS")&lt;/script&gt;',
    '&lt;script&gt;alert(&quot;XSS&quot;)&lt;/script&gt;'
]);
test('ampersand and angles', escapeHtml(sample2), 'Tom &amp; Jerry &gt; Spike &lt; Dog');
test('quotes', escapeHtml(sample3), [
    'Quote: &#39;Hello&#39; and &quot;World&quot;',
    'Quote: &#x27;Hello&#x27; and &quot;World&quot;',
    'Quote: &apos;Hello&apos; and &quot;World&quot;'
]);

if (passed === total) {
    console.log('ALL TESTS PASSED');
} else {
    console.log('FAILED:', passed + '/' + total);
}

