    let s = String(value);
    while (s.length < length) s = '0' + s;
    return s;
}
function sum(arr) { return arr.reduce((a, b) => a + b, 0); }
function average(arr) { return arr.length ? sum(arr) / arr.length : 0; }
function range(n) { return Array.from({ length: n }, (_, i) => i); }
function formatList(arr) { return '[' + arr.join(', ') + ']'; }
function logHeader(title) { console.log('--- ' + title + ' ---'); }

// Data processing helpers
function toUpperCaseAll(arr) { return arr.map(v => String(v).toUpperCase()); }
function filterPositive(arr) { return arr.filter(v => v > 0); }
function findMax(arr) { return arr.reduce((a, b) => (a > b ? a : b), -Infinity); }
function findMin(arr) { return arr.reduce((a, b) => (a < b ? a : b), Infinity); }
function joinLines(arr) { return arr.join('
'); }
function repeatValue(value, count) { return Array.from({ length: count }, () => value); }
function mapIndex(arr) { return arr.map((v, i) => i + ':' + v); }

